import React from "react"

import Todo from "./Todo"

const TodoList = ({ todos, setTodos,inputText,setInputText, secondSubmitHandler,secondTodos, setSecondTodos,secondInputText, setSecondText } ) => {
 
      return(
        <div className="todo-container" >
            <ul className="todo-list">
                {console.log(todos)}
                {todos.map(todo => (
                    <Todo
                     inputText={inputText}
                     setInputText={setInputText}
                     setTodos={setTodos}
                     todos={todos}
                     key={todo.id}
                     todo={todo}
                     text={todo.text} 
                     secondSubmitHandler={secondSubmitHandler}
                     secondTodos={secondTodos}
                     setSecondTodos = {setSecondTodos}
                     secondInputText= {secondInputText}
                     setSecondText= {setSecondText}

                     />
                  
                     ))}
                </ul>
            
    </div>
    )
};

export default TodoList
